function pad(str, len, chr)
  chr = chr or " ";
  local miss = len - string.len(str);
  if miss > 0 then
    str = str .. string.rep(chr, miss);
  end
  if miss < 0 then
    str = string.sub(str, 1, len);
  end
  return str;
end
 
function padNum(num, len, chr)
  chr = chr or " ";
  local str = tonumber(num);
  local miss = len - string.len(str);
  if miss > 0 then
    str = string.rep(chr, miss) .. str;
  end
  return str;
end
 
