function sortCode(code)
  local codes = {};
  codes[1] = code;
 
  for i = 1,3 do
    local _, c = commands.dt("rotatejocode", code, i);
    codes[i + 1] = c[1];
  end
 
  table.sort(codes);
  return codes[1];
end
 
